function urlEncoder(t,e,r){document.querySelectorAll(t).forEach(t=>{t.setAttribute(r,t.getAttribute(r)+encodeURI(t.getAttribute(e)))})}urlEncoder("a[data-title]","data-title","href");function backTop(o){document.querySelectorAll(o).forEach(o=>o.onclick=()=>document.querySelector('.viewport').scrollTo({behavior:"smooth",top:0}))}backTop("#backTop");